<!DOCTYPE html>
<html>
<head>
  <html>

  <head>
    <meta charset="UTF-8">
    <title>Seo Web</title>
    <script defer src="index.dart.js" type="application/javascript"></script>
  
    <style>
      .loading {
        display: flex;
        justify-content: center;
        align-items: center;
        margin: 0;
        position: absolute;
        top: 50%;
        left: 50%;
        -ms-transform: translate(-50%, -50%);
        transform: translate(-50%, -50%);
      }
      
      .loader-element-first {
        border: 16px solid #f3f3f3;
        border-radius: 50%;
        border-top: 16px solid black;
        border-right: 16px solid black;
        border-bottom: 16px solid black;
        border-left: 16px solid black;
        width: 80px;
        height: 10px;
      
        -webkit-animation: spin 2s alternate infinite;
        animation: spin 2s alternate infinite;
      }
      .loader-element-second {
        border: 16px solid #f3f3f3;
        border-radius: 50%;
        border-top: 16px solid black;
        border-right: 16px solid black;
        border-bottom: 16px solid black;
        border-left: 16px solid black;
        height: 10px;
        width: 80px;
      
        -webkit-animation: spin 2s ease-in-out infinite;
        animation: spin 2s ease-in-out infinite;
      }
      
      @-webkit-keyframes spin {
        0% {
          -webkit-transform: rotate(0deg);
        }
        100% {
          -webkit-transform: rotate(360deg);
        }
      }
      
      @keyframes spin {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
    </style>
  </head>
  
  <body>
    <div class="loading">
      <div class="loader-element-first"></div>
    </div>
    <div class="loading">
      <div class="loader-element-second"></div>
    </div>
    

  
  
    <script src="main.dart.js" type="application/javascript"></script>
  </body>
  
  </html>

  <script>

    const serviceWorkerVersion = null;

</head>
<body>
  <script>
    window.addEventListener('load', function(ev) {
      // Download main.dart.js
      _flutter.loader.loadEntrypoint({
        serviceWorker: {
          serviceWorkerVersion: serviceWorkerVersion,
        },
        onEntrypointLoaded: function(engineInitializer) {
          engineInitializer.initializeEngine().then(function(appRunner) {
            appRunner.runApp();
          });
        }
      });
    });
  </script>
